import React from 'react'
import {Section} from './Header.styled'
import { RiMenuAddLine } from "react-icons/ri";

export const Header= ()=>{
    return (
        <Section>
            <RiMenuAddLine style={{fill:"white", size: "64"}}/>
        <h2>HeaderLogo</h2>
        </Section>
    )
};
